// Event handler for interactions (slash commands)
client.on('interactionCreate', async interaction => {
  if (!interaction.isCommand()) return;

  const command = client.commands.get(interaction.commandName);
  if (!command) return;

  try {
    await command.execute(interaction);
  } catch (error) {
    console.error(error);
    await interaction.reply({
      content: 'There was an error while executing this command!',
      ephemeral: true,
    });
  }
});

// Function to register slash commands
async function registerCommands() {
  const commands = [...client.commands.values()].map(command => command.data.toJSON());

  const rest = new REST({ version: '9' }).setToken(token);

  try {
    console.log('Started refreshing application (/) commands.');

    // Replace YOUR_GUILD_ID with the guild/server ID where you want to register the commands globally
    await rest.put(Routes.applicationGuildCommands(clientId, guildId), {
      body: commands,
    });

    console.log('Successfully reloaded application (/) commands.');
  } catch (error) {
    console.error(error);
  }
}

const price = 55000;
const priceWithTax = 57895;

// Function to ping websites
async function pingWebsites() {
  // Load the website data from the database
  let data = {};
  try {
    data = JSON.parse(fs.readFileSync(databasePath));
  } catch (err) {
    console.error('Error reading database:', err);
  }

  // Loop through each user and their links
  for (const [userId, userData] of Object.entries(data)) {
    if (userData.links && Array.isArray(userData.links)) {
      for (const link of userData.links) {
        try {
          // Use Axios to make an HTTP GET request to the website URL
          const response = await axios.get(link);
          if (response.status === 200) {
            console.log(`Link ${link} Just Pinged.`);
          } else {
            console.log(`Error Pinging ${link} Link.`);
          }
        } catch (error) {
          console.error(`Error pinging ${link} error: `, error.message);
        }
      }
    }
  }
}

client.on('messageCreate', async message => {
  if (message.author.bot) return;

  // Split the message content into arguments
  const args = message.content.trim().split(/\s+/);
  const command = args.shift().toLowerCase();

  if (command === '-buyuptime') {
    if (message.channel.id !== buychan) {
      return message.reply(`This command can only be used in the specified buy channel.`);
    }
    
    const [link] = args;

    if (!link) {
      return message.reply('Invalid usage. Use `-buyuptime [link]`.');
    }

    const purchaseEmbed = new MessageEmbed()
      .setColor('#796904')
      .setAuthor(
        message.author.username,
        message.author.displayAvatarURL({ dynamic: true })
      )
      .setTimestamp()
      .addField(
        '<a:Shadow54:1136556924293349457> **- Purchasing __Uptime__ : **',
        `
> **\`\` # \`\` الـسـعـر مـع الـضـرائـب :** 
\`\`\`${priceWithTax}\`\`\` 

> **\`\` # \`\`الـسـعـر قـبـل الـضـرائـب :** 
\`\`\`${price}\`\`\`

> **لـديـك 60ث لـلــتـحـويـل** ⚠️

**رجـاءًا قــُـم بـكـتـابـة الـذي بالأسـفـل : **
\`\`\`
#credit 884120549473787924 ${priceWithTax}
\`\`\`
`
      );

    try {
      const purchaseMessage = await message.channel.send({ embeds: [purchaseEmbed] });
      const filter = (response) =>
        response.author.id === probot &&
        response.content.includes(
          `**💰 | ${message.author.username}, has transferred \`$55000\` to <@884120549473787924> **`
        );

      const collector = await message.channel.awaitMessages({ filter, max: 1, time: 60000, errors: ['time'] });
      const collected = collector.first();
      if (collected) {
        message.channel.send('**Purchase Success | تم رفع بوتك بنجاح <a:Shadow17:1136543581843230742>**');

        // Save the link to the database
        let data = {};
        try {
          data = JSON.parse(fs.readFileSync(databasePath));
        } catch (err) {
          console.error('Error reading database:', err);
        }

        // Add the link to the user's data in the database
        const userId = message.author.id;
        if (!data[userId]) {
          data[userId] = {
            links: [link],
          };
        } else {
          data[userId].links.push(link);
        }

        // Write the updated data back to the database file
        fs.writeFileSync(databasePath, JSON.stringify(data, null, 2));

        // Send log message in the logs channel
        if (logsChannelId) {
          const logEmbed = new MessageEmbed()
            .setColor('#796904')
            .setTitle('Uptime Purchase')
            .setDescription(`${message.author} has purchased uptime for the link: ${link}.`)
            .addField('Price', `Real price: \`${price}$\` :dollar:\nPrice With Tax: \` ${priceWithTax}$ \` :dollar:`, true)
            .setTimestamp();

          const logsChannel = message.guild.channels.cache.get("1138811972834562228");
          if (logsChannel && logsChannel.type === 'GUILD_TEXT') {
            logsChannel.send({ embeds: [logEmbed] });
          }
        }

        purchaseMessage.delete().catch(console.error);
      } else {
        message.channel.send('Purchase not approved.');
        purchaseMessage.delete().catch(console.error);
      }
    } catch (err) {
      message.channel.send('**Purchase failed | تم إنتهى الوقت** <a:Shadow6:1136540345342107668>');
      message.channel.send('https://media.discordapp.net/attachments/1138180179869564998/1138760943074029598/SHADOW.gif?width=637&height=87');
    }
  } else if (command === '-help') {
    // Display the help command information
    const helpEmbed = new MessageEmbed()
      .setColor('#796904')
      .setTitle('Available Commands')
      .setDescription('List of available commands and their usage:')
      .addField('\`-buyuptime \[link\] \`', 'Purchase uptime for the specified link.')
      .addField('\` -help\`', 'Display this help message.')
      .setTimestamp();

    message.channel.send({ embeds: [helpEmbed] });
  }
});

